// App.js
import React, { useState } from 'react';
import Collapsible from './Collapsible';

function App() {
  const [output1, setOutput1] = useState('');
  const [output2, setOutput2] = useState('');
  const [output3, setOutput3] = useState('');
  const [output4, setOutput4] = useState('');
  const [customerLog, setCustomerLog] = useState(null);
  const [defaultLog, setDefaultLog] = useState(null);

  const handleFileUpload = (event, setFile) => {
    setFile(event.target.files[0]);
  };

  const handleSubmit = async () => {
    const formData = new FormData();
    formData.append('customerLog', customerLog);
    formData.append('defaultLog', defaultLog);

    const response = await fetch('http://localhost:5000/upload', {
      method: 'POST',
      body: formData,
    });

    const data = await response.json();
    setOutput1(data.output1);
    setOutput2(data.output2);
    setOutput3(data.output3);
    setOutput4(data.output4);
    setPlotData(JSON.parse(data.plot));
  };

  function Collapsible({ title, content }) {
    const [isOpen, setIsOpen] = useState(false);

    return (
      <div>
        <div 
          style={{ 
            cursor: 'pointer', 
            padding: '10px', 
            backgroundColor: isOpen ? '#ddd' : '#eee', 
            border: '1px solid #ccc' 
          }}
          onClick={() => setIsOpen(!isOpen)}
        >
          {title}
        </div>

        {isOpen && <div dangerouslySetInnerHTML={{ __html: content }} />}
      </div>
    );
  }

  return (
    <div className="App">
      <label htmlFor="customerLog">Customer Log File:</label><br/>
      <input type="file" id="customerLog" onChange={(event) => handleFileUpload(event, setCustomerLog)} /><br/>

      <label htmlFor="defaultLog">Default Log File:</label><br/>
      <input type="file" id="defaultLog" onChange={(event) => handleFileUpload(event, setDefaultLog)} />

      <button onClick={handleSubmit}>Submit</button>

      {output1 && <Collapsible title="Params Diff" content={output1} />}
      {output2 && <Collapsible title="Logged messages" content={output2} />}
      {output3 && <Collapsible title="FW diff" content={output3} />}
      {output4 && <Collapsible title="Crash!! Time" content={output4} />}
      {plotData && <Collapsible title="Plot" content={<Plot data={plotData.data} layout={plotData.layout} />} />}
    </div>
  );
}

export default App;
